using System;
using System.Net.Http;
using System.Net.Http.Headers;
using System.Threading.Tasks;

namespace EjemploTaller
{

    public abstract class File
    {
        public string type { get; set; }
        public string content { get; set; }
        public string checksum { get; set; }
        public string description { get; set; }

        public override string ToString()
        {
            return $"type: {type}\ncontent: {content}\nchecksum: {checksum}\n";
        }
    }

    public class FileInfo : File
    {
        public string layout { get; set; }
        public override string ToString()
        {
            return base.ToString() + $"layout: {layout}\n";
        }
    }

    public class SignedFile : File
    {
        public string checksum_original { get; set; }
        public string status { get; set; }

        public override string ToString()
        {
            return base.ToString() + $"checksum_original: {checksum_original}\n";
        }
    }

    public class Session
    {
        public string session_token { get; set; }

        public override string ToString()
        {
            return $"session_token: {session_token}";
        }
    }

    public class Ticket
    {
        public string token { get; set; }
        public string api_token_key { get; set; }
        public File[] files { get; set; }
    }

    public class SignedFileResponse
    {
        public SignedFile[] files;
        public string session_token;

        public override string ToString()
        {
            var s = $"session_token: {session_token}\n";

            foreach (var f in files)
            {
                s += f.ToString();
            }

            return s;
        }
    }


    class Program
    {
        static void Main(string[] args)
        {
            RunAsync().Wait();
        }

        public static async Task RunAsync()
        {
            using (var client = new HttpClient())
            {
                Console.WriteLine("Iniciando proceso de firma");

                //Utilizar el Endpoint http://proxy-banco.modernizacion.gob.cl/v1/files/
                client.BaseAddress = new Uri("http://proxy-banco.modernizacion.gob.cl/v1/files");
                client.DefaultRequestHeaders.Accept.Clear();
                client.DefaultRequestHeaders.Accept.Add(new MediaTypeWithQualityHeaderValue("application/json"));

                var ticket = new Ticket
                {
                    token = "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJwcm9wb3NpdG8iOiJlamVtcGxvIHRva2VuIiwiZW50aWRhZCI6Ik1JTlNFR1BSRVMiLCJleHAiOiIyMDE2LTA3LTE0VDAxOjAwOjAwIiwicnV0IjoiMS05In0.oEmCLpiRtqC-G94kLIIYwar2cED3Vj22SfHrwqleL7M",
                    api_token_key = "system",
                    files = new[]
                    {
                        new FileInfo
                        {
                            type = "PDF",
                            content = "",
                            checksum = "cf4f277aeda480a1b3b9711d013d794b7cf909ba556e1a0484042cb138b241c4",
                            layout = "<AgileSignerConfig><Application id=\"THIS-CONFIG\"><pdfPassword/><Signature><Visible active=\"true\" layer2=\"false\" label=\"true\" pos=\"1\"><llx>250</llx><lly>300</lly><urx>350</urx><ury>450</ury><page>LAST</page><image>BASE64</image><BASE64VALUE></BASE64VALUE></Visible></Signature></Application></AgileSignerConfig>",
                            description = "cccccc"
                        },
                        new FileInfo
                        {
                            type = "PDF",
                            content = "",
                            checksum = "73868228803ae755edd49d0e0d361c22e8399aa8d3898e2b5d90e192c79bca82",
                            layout = "",
                            description = "cccccc"
                        }
                    }
                };

                Console.WriteLine("Obteniendo session_token");
                var callResource = await client.PostAsJsonAsync("tickets", ticket);

                if (callResource.IsSuccessStatusCode)
                {
                    var session = await callResource.Content.ReadAsAsync<Session>();
                    Console.WriteLine($"session_token: {session.session_token}");

                    Console.Write("Ingresar OTP:");
                    string otp = Console.ReadLine();

                    client.DefaultRequestHeaders.Add("OTP", otp);

                    Console.WriteLine("Iniciando solicitud de firma");
                    var response = await client.GetAsync("tickets/" + session.session_token);

                    if (response.IsSuccessStatusCode)
                    {
                        var signedFiles = await response.Content.ReadAsAsync<SignedFileResponse>();
                        Console.WriteLine($"Nro de documentos firmados:{signedFiles.files.Length}");

                        var count = 1;
                        foreach (var f in signedFiles.files)
                        {
                            var filename = $"documento_{count++}.pdf";
                            System.IO.File.WriteAllBytes(filename, Convert.FromBase64String(f.content));
                            Console.WriteLine(filename);
                        }
                    }
                }
            }
        }
    }
}
